import axios from 'axios';
import { wordsUrl } from '../urls'; 

export const getWords = async (id) => {
  return await axios.get(wordsUrl, { withCredentials: true })
    .then(function (response) {
      return response;
    })
    .catch(function (error) {
      console.log(error);
    });
}
